                <h4>Ce este GDPR?</h4>
                <p class=""text-justify"">

                    Ce este GDPR? Regulamentul general privind protecția datelor (denumit în continuare „GDPR” sau „Regulament GDPR”) a devenit lege în România începând cu 25 mai 2018. Pentru nerespectarea cerințelor de protecție, sancțiunile pot ajunge până la 4% din cifra de afaceri sau 20.000.000 euro. Investigația unei organizații române se face de Autoritatea de supraveghere din România.

                    Regulamentul GDPR are în centru său un element primordial: persoana fizică. Datele persoanei fizice trebuie protejate prin măsuri adecvate.

                    Regulament GDPR introduce un principiu important: responsabilitatea.

                    Pe scurt, responsabilitatea înseamnă că operatorul de date este singurul responsabil de a implementa măsurile adecvate pentru protecția datelor cu caracter personal și că poate demonstra că aceste măsuri au fost implementate. Cu alte c");
            WriteLiteral(@"uvinte, nu este suficient să protejăm datele cu caracter personal, ci trebuie și să documentăm aceste procese prin politici și proceduri adecvate, precum registre, analize, acorduri cu partenerii comerciali, consimțăminte documentate, informări către persoane. Aceste documente în format editabil și descărcabil se găsesc în cursul nostru GDPR care poate fi urmat online aici

                    În pas de traziție către era digitală, protecția datelor cu caracter personal este un subiect serios pe agenda fiecărei companii.

                    Acum că am aflat împreună ce este gdpr, în continuare, vom rezuma pe scurt GDPR, cu mențiunea că pe blogul LegalUp publicăm constant articole despre Regulamentul GDPR pentru a veni în spirijinul companiilor.
                </p>
